import PropTypes from 'prop-types';
import Drawer from '../../shared/Drawer/Drawer';
import { SIDE } from '../../../config/constants';

const EditConfiguration = props => {
    const { isEditDrawerVisible, onEditDrawerShow, onEditDrawerClose } = props;

    return (
        <Drawer
            side={SIDE.right}
            isEditDrawerVisible={isEditDrawerVisible}
            onEditDrawerShow={onEditDrawerShow}
            onEditDrawerClose={onEditDrawerClose}
            className={'bg-white'}
        >
            Configurations
        </Drawer>
    );
};

EditConfiguration.propTypes = {};

export default EditConfiguration;
